import React from "react";
import "./Home.scss";
import { motion } from "framer-motion";


const Home = () => {

  var anim = {
    opacity: 0,
    y: -40,
    transition: {
      type: "spring",
      bounce: 0.4,
      duration: 3,
    }
  }

  return (
    <div className="Home">
      <div className="layout-container">
        <div className="title">
          <h1>HI. I'm developer</h1>
          <p>Many challenges, many opportunities</p>
        </div>
        <motion.div initial={anim} whileInView={{ opacity: 1 }}>
          <div className="banner">
            <div className="sub-text">F*cking Code !</div>
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default Home;
